            welcomeMessage: 'Hey You Are Authorized'
        }


    }

    render() {
        return (
            <>
                <h1>Welcome!</h1>
                <div className="container">
                    Welcome {this.props.match.params.name}.

                </div>
                <div className="container">


                </div>
                <div className="container">
                    {this.state.welcomeMessage}
                </div>

            </>
        )
    }



}


export default BookingConfirmation
